//META{"name":"NoticeMeSenpai"}*//
'use strict';
function NoticeMeSenpai()
	{
	const
		_=this;
	var
		obs;
	_.getName=()=>'Notice Me, Senpai!';
	_.getDescription=()=>'Creates a Meow sound when you receive a Direct Message';
	_.getVersion=()=>'0.03';
	_.getAuthor=()=>'XFox Prower';
	_.load=function(){};
	_.start=function()
		{
		const
			D=document,
			audio=D.createElement('audio');
		audio.src='data:video/ogg;base64,';
		obs=new MutationObserver
			(
			function(m)
				{
				if(m[0].addedNodes.length)
					{
					audio.play();
					}
				}
			);
		obs.observe(D.getElementsByClassName('dms')[0],{childList:1});
		};
	_.stop=function()
		{
		obs.disconnect();
		};
	_.getSettingsPanel=function()
		{
		return '';
		};
	}